import './App.css';
import Card from './Components/Card';
import data from "./Components/data";


function arrcard( val ){
  return(
      <Card 
        title = {val.title}
        imglink = {val.imglink}
          info = {val.info}
      />
  )
}
function App() {
  return (
    <div className="App">

      <div className="cardblock">

      { data.map( arrcard )  }




      </div>

    </div>
  );
}

export default App;
